return (() => {
  const f = pluginFormulas['832d6f7a-42c3-43f1-a3ce-9a678272f811']['formatDate'];
  const monthDate = context.component?.variables?.[/* currentMonth */ 'f93ae950-c37e-4b29-b2b4-03e75a79adaa'];
  const range = context.component?.variables?.[/* range */ '9ad17ba4-c1d6-4b9f-bb40-feb30da1cf84'] || [];

  const cap = s => (s ? s.charAt(0).toUpperCase() + s.slice(1) : '');

  if (range.length === 0) {
    // Пусто → название месяца с заглавной
    return cap(f(monthDate, 'MMMM YYYY'));
  }

  if (range.length === 1) {
    // Один элемент → полная дата
    return f(range[0], 'DD MMMM YYYY');
  }

  // Два и более → диапазон (нормализуем порядок)
  const [a, b] = range;
  const d1 = new Date(a), d2 = new Date(b);
  const start = d1 <= d2 ? a : b;
  const end = d1 <= d2 ? b : a;

  return `${f(start, 'DD.MM.YYYY')} - ${f(end, 'DD.MM.YYYY')}`;
})()

