return (() => {
  const rawDate = context.component?.variables?.[/* currentMonth */ 'f93ae950-c37e-4b29-b2b4-03e75a79adaa']
  if (!rawDate) return [];

  const date = new Date(rawDate);

  const year = date.getFullYear();
  const month = date.getMonth();

  // 1-е число месяца
  const firstDay = new Date(year, month, 1);

  // Смещение: понедельник = 0, воскресенье = 6
  const startOffset = (firstDay.getDay() + 6) % 7;

  // Кол-во дней в текущем месяце
  const daysInMonth = new Date(year, month + 1, 0).getDate();

  // Кол-во дней в предыдущем месяце
  const daysInPrevMonth = new Date(year, month, 0).getDate();

  return Array.from({ length: 42 }, (_, i) => {
    let dayNum;
    let cellDate;
    let inMonth = true;

    if (i < startOffset) {
      // дни прошлого месяца
      dayNum = daysInPrevMonth - startOffset + i + 1;
      cellDate = new Date(year, month - 1, dayNum);
      inMonth = false;
    } else if (i >= startOffset + daysInMonth) {
      // дни следующего месяца
      dayNum = i - (startOffset + daysInMonth) + 1;
      cellDate = new Date(year, month + 1, dayNum);
      inMonth = false;
    } else {
      // дни текущего месяца
      dayNum = i - startOffset + 1;
      cellDate = new Date(year, month, dayNum);
      inMonth = true;
    }

    return {
      label: dayNum,
      iso: cellDate.toISOString(),
      inMonth
    };
  });
})()
